import React from 'react';

const TeamSection = () => {
  const teamMembers = [
    {
      name: 'Asad Ishaq',
      role: 'Web Developer',
      imageUrl: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSIh_YTSyT_COBAvig92iuHwBbDYg4pd3G1CHWe7O8-Pg&s',
      socialLinks: {
        facebook: 'https://www.facebook.com/',
        twitter: 'https://twitter.com/login',
        instagram: 'https://www.instagram.com/',
        linkedin: 'https://www.linkedin.com/',
      },
    },
    {
      name: 'Jahanzeb Khalid',
      role: 'Marketing Manager',
      imageUrl: './images/pexels-andrea-piacquadio-845434.jpg',
      socialLinks: {
        facebook: 'https://www.facebook.com/',
        twitter: 'https://twitter.com/login',
        instagram: 'https://www.instagram.com/',
        linkedin: 'https://www.linkedin.com/',
      },
    },
  ];

  return (
    <section className="team" style={{ marginTop: '7rem' }}>
      <h1 className="heading" style={{ marginTop: '-1.5rem' }} id="team">
        our team
      </h1>
      <p></p>
      {teamMembers.map((member, index) => (
        <div className="row" key={index}>
          <div className="card">
            <div className="image">
              <img src={member.imageUrl} alt={`Team member ${index + 1}`} />
            </div>
            <div className="info">
              <h3>{member.name}</h3>
              <span>{member.role}</span>
              <div className="icons">
                <a href={member.socialLinks.facebook} className="fab fa-facebook-f"></a>
                <a href={member.socialLinks.twitter} className="fab fa-twitter"></a>
                <a href={member.socialLinks.instagram} className="fab fa-instagram"></a>
                <a href={member.socialLinks.linkedin} className="fab fa-linkedin"></a>
              </div>
            </div>
          </div>
        </div>
      ))}
    </section>
  );
};

export default TeamSection;
